import React from 'react';

const ProjectForm = ({
  projectTitle,
  projectDescription,
  onTitleChange,
  onDescriptionChange,
  onSubmit,
}) => {
  return (
    <section className="project-form">
    <div style={{width: '100%', height: '100%', background: '#2563EB', borderRadius: 30}} />
      <form onSubmit={onSubmit}>
       
        <label>
          Project Description:
          <textarea
            value={projectDescription}
            onChange={onDescriptionChange}
            required
          />
        </label>
        <button type="submit">Submit Project</button>
      </form>
    </section>
  );
};

export default ProjectForm;
